import './popup.css'

function Popup(props) {
    switch (props.popupType) {
        case 'save':
            return (
                <div className={"savePopup"}>
                    <h1>Save Reminders</h1>
                    <p>Would you like to save your reminders?</p>
                    <p>saving your reminders will clear your queue of undos and redos</p>
                    <button className={"button"}>Cancel</button>
                    <button className={"button important-button"}>Save</button>
                </div>
            );
        case 'confirmation':
            return (
                <div className={"confirmationPopup"}></div>
            );

        case 'error':
            return (
                <div className={"errorPopup"}></div>
            );
    }
}

export default Popup;
